import React from "react";

import "./Alert.css";

const alert = props => {

    let fotoClasses= "foto-drawer";
    let step = props.alert

    if(props.alert) {
        fotoClasses= "foto-drawer open";
    }
    return(

            <nav className={fotoClasses} onClick={fotoClasses= "foto-drawer"} >
                <div className="fotogrid">
                    <h1>Listo !</h1>
                    <p>
                        Sus datosingresados ya fueron envios a nuestars instalaciones y estaremos en ontacto con usted lo mas pronto posible
                    </p>
                    <button onClick={
                        this.setState((prevState) => {
                            return { step: !prevState.step }
                          })
                    }>
                        okay?
                    </button>
                </div>
            </ nav>

    );
};

export default alert;
